async def request_body_to_args(
    required_params: List[ModelField],
    received_body: Optional[Union[Dict[str, Any], FormData]],
) -> Tuple[Dict[str, Any], List[ErrorWrapper]]:
    values = {}
    errors = []
    for field in required_params:
        received_value = received_body.getlist(field.alias) if isinstance(received_body, FormData) else received_body.get(field.alias)
        if received_value:
            if lenient_issubclass(field.type_, list):
                values[field.alias] = received_value
            elif lenient_issubclass(field.type_, set):
                values[field.alias] = set(received_value)
            elif lenient_issubclass(field.type_, tuple):
                values[field.alias] = tuple(received_value)
            else:
                values[field.alias] = received_value[0]  # Assume single value for non-sequence types
        elif field.required:
            errors.append(ErrorWrapper(MissingError(), loc=("body", field.alias)))
            continue
        else:
            values[field.alias] = deepcopy(field.default)
    return values, errors
